import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Telahome from './Telahome'; // Página inicial
import TabelaUsuario from './TabelaUsuarios'; // Outra página
import UserDetails from './UserDetails'; // Detalhes do usuário
import Download from './Download'; // Página de download
import FAC from './FAC'; // Página de FAC
import Login from './Login'; // Página de login
import './App.css';

function App() {
  return (
    <Router>
      <div className="IterMob">
        <Routes>
          <Route path="/" element={<Telahome />} /> {/* Página inicial */}
          <Route path="/user-details/:id" element={<UserDetails />} /> {/* Detalhes do usuário */}
          <Route path="/download" element={<Download />} /> {/* Página de download */}
          <Route path="/fac" element={<FAC />} /> {/* Página de FAC */}
          <Route path="/login" element={<Login />} /> {/* Página de login */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
